import Home from './component/Home';
import {BrowserRouter} from 'react-router-dom'
import './index.css';
import ErrorPage from './component/ErrorPage';
import {ErrorBoundary} from 'react-error-boundary'
function App(){
    return(
<>
<ErrorBoundary fallBackUi={<ErrorPage/>}>
<BrowserRouter>
<Home/>
</BrowserRouter>
</ErrorBoundary>
</>
    )
}
export default App;
